import React, { useEffect, useState } from "react";
import Navbar from "./Components/Navbar";
import loadingPic from './Components/bg.png'
import "./App.css";

function App() {
  const [load, setLoad] = useState(true);

  useEffect(() => {
    setTimeout(() => setLoad(true), 3000);
  }, []);

  return (
    <>
      {
        load ? (
          <div className='bg-transparent'>
            <img src={loadingPic} className="bg-transparent" height={100} width={100} alt="logo pic" />
          </div>
        )
          :
          <Navbar />
      }
    </>
  );
}

export default App;
